import Link from 'next/link';
import styled from 'styled-components';

const Logo = styled.h1`
  background: red;
`;

const red = styled.div`
  background: red;
`;
export default function Header() {
  console.log(Logo);
  return (
    <header>
      <div className="bar">
        <Logo>
          <Link href="/">Outfits</Link>
        </Logo>
      </div>
      <div className="sub-bar">
        <p>Search</p>
      </div>
    </header>
  );
}
